    %
    function out_h = h( this, in_1, ~, t )
      % Calculate the residual of the invariants h.

      % Extract properties
      L__s2 = this.m_L__s2;
      L__s3 = this.m_L__s3;
      R__g2 = this.m_R__g2;
      R__g3 = this.m_R__g3;
      gamma = this.m_gamma;
      delta = this.m_delta;

      % Extract inputs
      y__1 = in_1(1);
      y__2 = in_1(2);
      y__3 = in_1(3);
      y__4 = in_1(4);
      y__5 = in_1(5);
      y__6 = in_1(6);
      y__7 = in_1(7);
      y__10 = in_1(10);
      y__11 = in_1(11);
      y__12 = in_1(12);
      y__13 = in_1(13);

      % Evaluate function
      t2 = sin(0.6283185308e5 * t);
      t3 = 0.2e1 * t2;
      t6 = exp(-delta * (y__4 - y__6 + y__7 + t3));
      t7 = t6 * 0.577215664901532860606512090082e0;
      t10 = exp((y__4 + y__5 + y__7 + t3) * delta);
      t11 = t10 * 0.577215664901532860606512090082e0;
      out_1 = t7 - t11 - y__11;
      t14 = exp(delta * (y__3 - y__5 - y__7 - t3));
      t15 = t14 * 0.577215664901532860606512090082e0;
      out_2 = t15 - t11 + y__12;
      t18 = exp(-delta * (y__3 + y__6 - y__7 - t3));
      t19 = t18 * 0.577215664901532860606512090082e0;
      out_3 = -t7 + t19 - y__13;
      out_4 = -t15 + t19 + y__10;
      t22 = -0.5e0 * L__s2 + 0.5e0 * L__s3;
      t25 = R__g3 * L__s2;
      t28 = R__g2 * L__s3;
      out_5 = 0.1e1 / L__s3 / L__s2 * (y__1 * t22 + y__2 * t22 - 0.1e1 * y__11 * t25 - 0.1e1 * y__12 * t28 - 0.1e1 * y__13 * t25 - 0.1e1 * y__10 * t28 + L__s2 * y__4 - 0.1e1 * L__s3 * y__5 + L__s2 * y__6 - 0.1e1 * L__s3 * y__3);

      % Store outputs
      out_h = zeros(5, 1);
      out_h(1) = out_1;
      out_h(2) = out_2;
      out_h(3) = out_3;
      out_h(4) = out_4;
      out_h(5) = out_5;
    end % h
